import "./App.css";

// import Collaborate from "./pages/collaborate";
import CourseDetails from "./pages/courseDetails";
import Payment from "./pages/payment";
import Profile from "./pages/profile";
import Home from "./pages/home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  BrowserRouter,
  Redirect,
} from "react-router-dom";
import Cfdteam from "./pages/cfdteam";
import FooterContent from "./atom/footercontent";
import HeaderContent from "./atom/headercontent";
import Page404 from "./pages/404page";
import Course from "./pages/Course";
import Project from "./pages/Project";
import Cooperate from "./pages/Cooperate";
import Register from "./pages/register";
import "./assets/css/style.scss";

function App() {
  // return <Cfdteam />;
  return (
    <BrowserRouter>
      <Router>
        <HeaderContent />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/team" component={Cfdteam} />
          <Route exact path="/course" component={Course} />
          <Route exact path="/course/:name" component={CourseDetails} />
          <Route path="/register" component={Register} />
          <Route path="/cooperate" component={Cooperate} />
          <Route path="/payment" component={Payment} />
          <Route path="/profile" component={Profile} />
          <Route path="/project" component={Project} />

          <Route path="/404" component={Page404} />
          <Redirect to="/404" />
        </Switch>
        <FooterContent />
      </Router>
    </BrowserRouter>
  );
}

export default App;
